import React from "react";
import { Route, Redirect } from "react-router-dom";

const PrivateRoute = ({ component: Component, ...rest }) => {
  return (
    <Route
      {...rest}
      render={(props) =>
        !isAuthenticated ? (
          <Redirect to="/login"></Redirect>
        ) : (
          <Component></Component>
        )
      }
    ></Route>
  );
};

export default PrivateRoute;
